import React from "react";

const ContactPage = () => {
  return (
    <main>
      <form action="POST">
        <h1>Contact Me!</h1>
        <fieldset>
          <legend>Personal Information</legend>
        </fieldset>
      </form>
    </main>
  );
};

export default ContactPage;
